            if (result != null)
                return result.Value;

            throw new JsonException();
        }

        /// <summary>
        /// Writes the ModelId to the json writer
        /// </summary>
        /// <param name="writer"></param>
        /// <param name="modelId"></param>
        /// <param name="options"></param>
        public override void Write(Utf8JsonWriter writer, ModelId? modelId, JsonSerializerOptions options)
        {
            writer.WriteStringValue(modelId.HasValue ? ModelIdValueConverter.ToJsonValue(modelId.Value).ToString() : "null");
        }
    }
}
